      const actionValue = attributeValue(actions)
      if (controllerValue) {
        element.setAttribute(
          stimulusApplication.schema.controllerAttribute,
          controllerValue
        )
      }
      if (actionValue)
        element.setAttribute(
          stimulusApplication.schema.actionAttribute,
          actionValue
        )
    })
}

